window.bookSummaryJSON = "<p>Skree loved playing Massively Multiplayer online role-playing games. When he becomes the first player to reach level 100 in his favorite game, he is offered the chance to test a brand new game. Never one to read the fine print, he jumped at the chance to be the very first player to see the brand new game.</p> <p>But some opportunities are just too good to be true.</p> <p>Awaking to find himself trapped in a brand new world and struggling to survive, James must find a way to master the game and escape the world of Raiya. Angry wildlife, gargantuan monsters, and mysterious allies are not the only things he has to worry about. Will he have the backbone to do what is right and not what is easiest?</p> <p>Will the carefree Skree find something worth fighting for? Something worth dying for?</p>"; 
